// import logo from './logo.svg';
import './App.css';
import NavbarComp from './components/Navbar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <NavbarComp/>
      </header>
      <footer>   
        <p>
            Thank you for taking the time to check this out --Hope you Have a Good Day   
        </p>
      </footer>
    </div>
  );
}

export default App;
